import { useEffect, useState } from "react"

function Free(){
  const [data, setData] = useState([])
  useEffect(() => {
      fetch("http://localhost:3006/e-commerce")
          .then((res) => {
              return res.json()
          })
          .then((resp) => {
              setData(resp)
              console.log(resp)
          })
  }, [])
  return(
    <div>
     {data.map((item) => (
      <div>
      <img src="{item.img}"/>

      </div>
     ))}
    </div>
  )
}
export default Free;
